window.bookSummaryJSON = "<p>Ridge, Sardelle, and their comrades may have rescued Tolemek's sister and freed the dragon, but trouble awaits at home. </p> <p>The king is missing, a secret organization is hunting sorcerers, and the capital is more vulnerable than ever to enemy attack. Worst of all, at least from Ridge's point of view, someone put that jackass Colonel Therrik in charge of the flier battalion. </p> <p>Ridge and his allies have a lot of problems to fix, but they can't show their faces in the capital without being arrested or shot. This time it's going to take a lot more than magic to save the country. </p>"; 
